import React from 'react'
import {Text , StyleSheet , View , ScrollView , TextInput} from 'react-native'

const App = () => {
  return (
   <view style={Styles.container}>
     <Text>Belajar Membuat aplikasi sederhana</Text>

     <view></view>
   </view>
  )
}


const Styles = StyleSheet.create({
  container : {
    padding : '10px' ,
    textAlign : 'center' ,
    fontSize : '20px'
  }
})

export default App
